import './App.css';
import Button from '@material-ui/core/Button';


function Titulo(){
  return(
    <Button color="primary" className={classes.button}>
        Primary
    </Button>
  );
}


function App() {
  return (
    <div className="App">
      Teste
    </div>
  );
}

export default App;
